import {ContainerRanking, RenderData, FontNameAndRanking,NameRanking, ColorFirst} from '../style/style'
import axios from 'axios'
import { useEffect, useState } from 'react'
const zero = 0;

function Ranking () {
    const [players, setPlayers ] = useState([])
    async function RankingPlayers () {
        const data = await axios.get('http://localhost:3333/busca')
        setPlayers(data.data)
    }
    useEffect(() => {
        
       RankingPlayers()
    },[])
    return (
        <ContainerRanking>
            <FontNameAndRanking>
                Nome                 Rating
            </FontNameAndRanking>
            {
                players.map((element,i) => {
                    return (
                        <RenderData>
                            <NameRanking> 
                    {i + 1 === 0 && (<ColorFirst>{i + 1}</ColorFirst>)} {element.name} {element.rating}</NameRanking>
                        </RenderData>
                    )
                })
            }
        </ContainerRanking>
    )
}


export default Ranking
